INSERT INTO `tblhistory` VALUES ('V20160617CBL01001', 'U Phone Kyaw, 48 years old\r\nLDLT in India (March 15) for hepatitis B + HCC (moderately differentiated T1, no lymphovascular invasion).  HCV negative.\r\nCurrent medications\r\n-	Sirolimus 1mgOM and 1.5mg OM alternate day (reduced 2mg OM every day from May 16)\r\n-	MMF 500mg BD (reduced it from 1000mg BD Oct 15)\r\n-	Tenofovir 300mg OD\r\n-	Cal + Vit D\r\n-	Prednisolone stopped on May 16\r\n-	Tacrolimus has stopped in Sep 15 in view of rising creatinine level\r\nInvestigations (16 June 16)\r\n-	ALT 152  61 \r\n-	AST 85  32\r\n-	ALP 113  79\r\n-	Total Bilirubin 0.64\r\n-	eGFR 65.1\r\nO/E\r\n-	Afeb\r\n-	BP 130/95mmHg\r\n-	Mild splenomegaly, no ascites\r\nImpression: Post liver transplant patient with transaminitis\r\nPlan\r\n-	To do \r\no	FBC\r\no	PT/INR\r\no	LFT\r\no	CMV DNA\r\no	EBV PCR\r\no	HSV PCR\r\no	Hepatitis A IgM\r\no	Hepatitis E viral load\r\no	Hepatitis B viral load\r\no	HCV viral load\r\no	Sirolimus level\r\no	Ultrasound liver\r\no	CXR\r\no	Urine C&S\r\no	Fasting lipid profile\r\no	HbA1c\r\no	Calcium corrected\r\no	Serum Phosphate level\r\no	25-OH vitamin D\r\no	Urine Protein creatinine ratio\r\n-	Add Vitamin E 400IU BD x 2 weeks\r\n-	Monitor BP at home.  KIV treat hypertension if persistently >140/90mmHg\r\n-	Increase Sirolimus 1mg BD as OM dose is not enough\r\n-	To do LFT today.  KIV liver biopsy\r\n-	TCU 29-June-16', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:21:03.145561', '17', '2016-07-25 14:21:03.145561');
