INSERT INTO `tblhistory` VALUES ('V20160623CBL01007', 'Daw Thida Lay, 52 years lady\r\nSeen by Dr Thwin on 30-May-16\r\nKnown case of Hepatitis B (since 1996).  Patient has been stopped on Jan 2016 by herself (HBV VL 74IU/mL at the time of patient stopping anti-hepatitis B treatment) and restart again by herself in May 16 in view of Loss of Appetite, Breathlessness and change in urine colour (red colour). Total duration of taking Tenofovir 300mg OD x 1year.\r\nHepatitis C – negative (according to patient)\r\nNo known drug allergy\r\nMedical history\r\n-	Hypertension x 2 years on Amlodipine 5mg OD (Actual prescription 5mg BD)\r\n-	Depression (Jan 2015) and took Sertraline x 1 year.  Currently no longer on any treatment\r\nSurgical history\r\n-	Tonsillectomy 5 years ago\r\nFamily history\r\n-	Father has HCC (Hepatitis B) and passed away at the age of 80\r\n-	Mother passed away ? lung disease\r\n-	Hypertension in Father\r\nLatest investigations result (Feb 2016)\r\n-	AFP – 5.8 (normal)\r\n-	ALT – 37 (<33)\r\n-	AST – 36 (<32)\r\n-	Total Bilirubin 7 (normal)\r\n-	USG  No SOL, cirrhosis of liver\r\n-	HBV viral load 74 IU in Jan 16\r\nC/O\r\n-	Patient has concerned to continue Tenofovir due to tablet size as well as non-specific symptoms after taking tenofovir\r\nO/E\r\n-	Afeb\r\n-	BP – 165/97mmHg\r\n-	Pulse rate - 90\r\n-	No palpable liver and spleen\r\n-	? mild ascites \r\n-	Mild pedal oedema\r\nPlan\r\n-	To do Fibroscan to assess the liver stiffness\r\n-	Continue anti-hypertensive and follow up with Prof U Aung (Cardiologist)\r\n-	Reinforce to take anti-hypertensive regularly with correct dose in light of BP 165/97mmHg today\r\n-	Switch to Entacavir 0.5mg OD (small size of tablet) as the patient cannot tolerate Tenofovir \r\n-	TCU 23-June-16 with ALT, AST, ALP, AFP, Unconjugated bilirubin, Conjugated bilirubin, Urea, Creatinine, Calcium corrected, 25-OH Vitamin D, Phosphate level, Full Blood count, PT/INR, Albumin, HbA1c, Fasting lipid, Urine Protein:Creatinine ratio\r\nSeen by Dr Thwin on 23-June-16\r\nNoted results (20-June-16)\r\n-	ALT – 36 (<33)\r\n-	AST – 41 (<32)\r\n-	ALP – 146 (<104)\r\n-	Bil – 0.9\r\n-	AFP – 5.8 (Apr 16)\r\n-	Fibroscan – 35.8 F4\r\n-	Albumin – 3.73\r\n-	Calcium – 8.36 (8.4-10.4)\r\n-	Hb – 13.3\r\n-	WBC – 6.91\r\n-	Plt – 156\r\n-	INR – 1.05\r\n-	Urine PCR – 0.08\r\n-	HbA1c – 5\r\n-	Phosphate – 1.08\r\n-	Cholesterol 179.9\r\n-	LDL – 118.5\r\n-	TG – 80.5\r\n-	HDL – 50.2 (>65)\r\nPatient is currently taking Entecavir.\r\nNo known alcohol history.  According to the patient, liver surface is not smooth on Ultrasound in BKK in 2014.\r\nImpression: Child A liver cirrhosis with underlying chronic hepatitis B infection to rule out other cause of liver cirrhosis\r\nPlan\r\n-	To do HBV viral load, anti-HCV, HCV viral load, HIV screen, Anti-LKM, IgG, anti-smooth muscle, anti-mitochondrial antibody, ANA, AFP\r\n-	To do creatinine level and if it is normal, proceed with CT Triphasic (abdomen and pelvis)\r\n-	KIV OGD to surveillance for varices\r\n-	Continue Entecavir 0.5mg OD\r\n-	TCU 29-June-16', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:15:00.115323', '17', '2016-07-25 14:15:00.115323');
