INSERT INTO `tblhistory` VALUES ('V20160628CBL01002', 'U Zeyar Maung Maung, 45 years\r\nLDLT Jan 16 for Hepatitis C + HCC.  Hepatitis C was treated with Inj x 6 months and failed.  Now taking oral drugs x 1.5 months.  Hep C is not cleared at the time of transplant.  Hepatitis C genotype 3.  HCV viral load negative post liver transplant 1 month\r\nExplant: multi-focal HCC involving a major branch of PV\r\nAFP before transplant >50,000 and ~1900 after gamma knife reduction of PV thrombus\r\nLatest AFP in India (June 16) >800\r\nAcute cellular rejection on POD 9 and treated with Pulse x 3 days (Biopsy proven)\r\nPET scan (June 16)  ? recurrence HCC\r\nCurrent Medications\r\n1.	Tacrolimus 0.5mg BD (reduced it from 1.5 BD on 2-June-16 )\r\n2.	Cellcept 250mg BD since transplant\r\n3.	Sirolimus 2.5mg BD (increased it from 2mg BD on 14-June-16)\r\n4.	Prednisolone 2.5mg OM (reduced it from 5mg OM on 14-June-16)\r\n5.	Sorafenib 200mg BD since 8-June-16\r\n6.	Vit C 500mg OD\r\n7.	Vit B 20mg OD\r\n8.	Pantocid 1 tab ½ before breakfast\r\n9.	Calcium 1 tab TDS\r\n10.	Sofosbuvir 400mg OM \r\n11.	Ribavirin 200mg BD\r\nIssues\r\n1.	Post liver transplant patient with ? tumor recurrence on the background of Hep C and HCC\r\nPlan\r\n-	FBC, LFT, Urea and Electrolyte, Creatinine, Sirolimus, Tacrolimus level, HbA1c, CMV DNA, AFP on 20-June-16)\r\n-	TCU 23-June-16\r\n-	KIV adjust the immunosuppression, KIV repeat CT scan in Sep 16\r\n-	Pls contact to Dr Thant Zin Win if the patient needs to add any new medications\r\nSeen by Dr Thwin Maung Aye on 28-June-2016\r\nNoted blood results\r\nSirolimus 7.2\r\nTacrolimus < 2\r\nCMV DNA – ND\r\nAFP > 400\r\nHbA1c 6.9\r\nHb 12.6\r\nWBC 3.67\r\nPlt 105\r\nGlucose 153 (High)\r\nUrea 7\r\nCreatinine 0.6\r\nUric acid 3.8\r\nCalcium 8.7\r\nAlbumin 3.7\r\nALT 38\r\nAST 43 (High)\r\nALP 73\r\nTotal Bil 0.8\r\nConsultation note\r\n•	C/O of hand and foot syndrome due to Sorafenib.  Patient stopped Sorafenib 2 days ago.\r\nCurrent medications\r\n•	Tacrolimus 0.5mg BD (reduced it from 1.5 BD on 2-June-16 )\r\n•	Cellcept 250mg BD since transplant\r\n•	Sirolimus 2.5mg BD (increased it from 2mg BD on 14-June-16)\r\n•	Prednisolone 1mg OM (reduced it from 2.5mg OM on 29-June-16)\r\n•	Sorafenib 200mg BD since 8-June-16 (Stopped on 26-June-16 due to intolerable side-effect)\r\n•	Vit C 500mg OD\r\n•	Vit B 20mg OD\r\n•	Pantocid 1 tab ½ before breakfast\r\n•	Calcium 1 tab TDS\r\n•	Sofosbuvir 400mg OM \r\n•	Ribavirin 200mg BD\r\n\r\nImpression\r\n1.	Post liver transplant patient with high AFP ? HCC recurrence\r\n2.	NODAT\r\nPlan\r\n1.	Reduce Prednisolone to 1mg daily x 2 weeks and then stop (12-Jul-16). Stop Pantocid once Prednisolone is stopped. To repeat LFT, FBC, Urea and creatinine, Fasting glucose level, Tacroliumus level and Sirolimus level, HCV viral load, AFP on 18-June-16.  KIV stop MMF next visit. Plan to continue Sirolimus (high dose) and Tacrolimus (low dose) in light of HCC recurrence.\r\n2.	If hand and foot syndrome symptoms tolerate, re-introduce Sorafenib 200mg BD (3days on and 4 days off)\r\n3.	KIV add anti-DM if FBS still high after stopping Prednisolone\r\n4.	Anti-HCV treatment will finish in Sep 16\r\n5.	To repeat CT scan (Abdomen and Thorax)/ PET scan in Sep 2016\r\n6.	TCU 21-Jul-16\r\n\r\n\r\n\r\nReviewed by Dr Thwin on 21-Jul-16\r\nNoted Blood results\r\n1.	Hb 11.6, TWC 3.25 (Lymphocyte – 0.61), Plt – 82\r\n2.	Alb 3.6, ALT 26, AST 27, ALP 52, Total Bil 0.9\r\n3.	Siroliums level  7.1 and tacroliumus level 2.5 (14-Jul-16)\r\nPatient cannot tolerate to Sorafenib 200mg BD\r\nC/O dysuria x 2 days\r\n\r\nImpression\r\n1.	Post liver transplant patient (HCC + Hep C) with high AFP ? HCC recurrence\r\n2.	?NODAT\r\n\r\nCurrent medications\r\n•	Tacrolimus 0.5mg BD (reduced it from 1.5 BD on 2-June-16 )\r\n•	Cellcept 250mg BD since transplant\r\n•	Sirolimus 2.5mg/2mg (reduce it from 2.5mg BD on 21-Jul-16)\r\n•	Prednisolone 1mg OM (reduced it from 2.5mg OM on 29-June-16)\r\n•	Sorafenib 200mg BD since 8-June-16 (Stopped on 26-June-16 due to intolerable side-effect)\r\n•	Vit C 500mg OD\r\n•	Vit B 20mg OD\r\n•	Pantocid 1 tab ½ before breakfast\r\n•	Calcium 1 tab TDS\r\n•	Sofosbuvir 400mg OM \r\n•	Ribavirin 200mg BD\r\n•	Centrum 1 tab OD\r\n\r\nPlan\r\nReduce SIrolimus to 2.5mg/2mg\r\nTo proceed with PET scan as planned in Sep 16 and repeat HCV viral (end of treatment) in Sep 16\r\nTake Sorafenib as tolerated\r\nTo do Urine RE and Urine C&S today in light of dysuria\r\nAdvise to monitor home sugar level.  KIV treat if blood sugar level is high\r\nHepatic functional package and sirolimus level on 3-Aug-16\r\n\r\nTCU: 1month with FBC, hepatic function package, Creatinine', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:24:40.048342', '17', '2016-07-25 14:24:40.048342');
INSERT INTO `tblhistory` VALUES ('V20160628CBL01004', 'Daw Moe Thida Tun, 42 years old\r\nSeen by Dr Thwin Maung Aye on 28-June-16\r\nC/O\r\n-	Epigastric pain after eating 1 month ago.  Associated with sweating. Also suffer similar attack last year.  Pain is radiated to the back.  Pain lasts for 15 mins and is relieved with taking injection at clinic.  Not associated with fever, no change in urine color.  Associated with watery diarrhea.\r\nNoted\r\n-	Hb 9.5 (May 2016) likely due to heavy Mens (15 days cycle with 7 days duration) on Ferrovit (Ferrous fumerate + Folic acid + B12) 1 BD\r\n-	US (Abdomen) in May 2016: 3 gall stone (7 to 8mm) and small left ovarian cyst.  She is active follow up with Gynecologist for ovarian cyst and is currently on conservative management\r\nPast medical history\r\n-	NAD\r\nNo Known drug allergy', '', '', 'Current medications\r\n1.	Cetirizine 10mg OD x 10 years due to itchiness over face and both\r\n2.	Ferrovit (Ferrous fumerate + Folic acid + B12) 1 BD\r\n3.	Urso 1 BD\r\n4.	Esomeprazole 40mg OD', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:12:46.126688', '17', '2016-07-25 14:12:46.126688');
INSERT INTO `tblhistory` VALUES ('V20160629CBL01001', 'Daw Le Le Oo, 43years old, referred from Sakura hospital CEO Dr Htin Paw\r\nSeen by Dr Thwin Maung Aye on 29-June-16\r\nKnown case of Hepatitis B since 2002\r\nNoted results (May 16)\r\n-	ALT 35\r\n-	AST 54.3 (<31)\r\n-	GGT 25.2 (<38)\r\n-	ALP 67.1\r\n-	Tot Bil 1.62 (1.2)\r\n-	HbsAb – Negative\r\n-	Ultrasound (Abdomen, June 2016): Mild fatty liver/mild chronic hepatitis\r\nCo-Morbidity\r\n-	Hypertension on Telmisartan 20mg daily.  Active follow up with cardiologist Dr Henry Yee\r\n-	Abortion x 2 times\r\n\r\n\r\nReviewed by Dr Thwin on 21-Jul-16\r\nNoted blood results\r\nHbeAg – Negative\r\nHbeAb – Positive\r\nHBV VL – 286 IU/mL\r\nALT – 26, AST – 27, ALP – 47, Alb – 3.9, Total bil -0.8\r\nUrea - 7, Cr - 0.6, Na - 140, K - 4.3\r\nTWC - 7.33, Hb - 13.5, Plt - 279\r\nINR - 1\r\nAFP - 1.8\r\nHCV and HIV – NR\r\nFibroscan: 4.8Kpa, F0\r\nNoted LFT – normalizing\r\nNo C/O\r\nPatient is not taking Telmisartan in light of dizziness', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 13:54:54.495006', '17', '2016-07-25 13:52:55.854797');
