INSERT INTO `tblhistory` VALUES ('V20160718CBL01016', 'Consultation notes\r\nOGD scopes done in 2013 and 2014\r\nOGD (2013)  Antrum ulcer (Biopsy pending)\r\nColonoscopy (2014)  clear\r\nUS (Apr 16)  Gallstone 5mm, gall bladder wall not thicken, bilateral renal cyst\r\nLSCS x 2 times 23 years ago\r\nChief complaints\r\nPain in abdomen off and on since 2013.  Nausea (+).  Pain also refer to the back and left shoulder.  Pain is not relieved by usual medication.  Abdominal pain is a little bit relieved after defecation.  Pain is worse at night.   Pain score 4.\r\nLoss of appetite (+)\r\nChange in bowel habit x 5 months. No blood in stool.\r\nNo change in urine colour.\r\nNoticeable weight loss 10lb within 6 months\r\nPhysical Examinations\r\nAfeb\r\nBP 115/66mmHg\r\nWeight 61.6kg\r\nO/E\r\nCentral peri-umbilical dullness, shifting dullness (+)\r\nActive issues/Problem lists\r\n1.	Abdominal pain with weight loss to rule out organic lesion for further evaluation\r\nPlan\r\nContinue Hepatitis B and hypertension treatment\r\nTo review on 21-Jul-16 with scan and blood results\r\nTo bring the previous scopes results\r\nInvestigations orders\r\n1.	Creatinine \r\n2.	If creatinine is normal CT (Abdomen and pelvis) triphasic and CT (thorax)\r\n3.	CA 125\r\n4.	AFP\r\n5.	Hepatic function package\r\n6.	HBV viral load\r\n7.	Calcium\r\n8.	Phosphate\r\n9.	25-OH vitamin D\r\nMedications\r\n1.	Rabeprazole 10mg ½ hour before breakfast\r\n2.	Spacovin 40mg TDS/PRN\r\nTCU: 21-Jul-16', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:16:44.822707', '17', '2016-07-25 14:16:44.822707');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01001', '-	Hep B infection since 1996. No treatment till 2012.\r\n-	CT-abd (Nov 2012): 4.8cmx5.3cm size HCC at seg VII. Seg VII resection done in Dec 2012. Histo report (2012): HCC (Mixed Trabecular and pseudoacinar type, seg VII). Background of mixed nodular cirrhosis. \r\n-	Took Tenofovir for 2 years (2012-2014) and stopped x 6 months.  And then HBV viral load again positive and re-start to Entecavir 0.5mg x 6months and then stopped.\r\n-	CT (19th Mar 13): 1.2cm x 1.7cm recurrent HCC at seg II. Early portal hypertension (+) and small ascites. Ethanol ablation done to seg II on 22nd Mar 13.\r\n-	CT (4th May 13): Recurrent HCC at seg II, unchanged from previous scan (Mar 13). \r\n-	AFP : 28.8 2.94.176.115.619.820.323.6 (Mar-13 to July-16)\r\n-	HBV VR (Sep -15) : 393\r\n-	HBV VR (Dec -15) : ND\r\n-	HBV VR (Jul – 15) : ND\r\n-	USG (9 Jul 16): small nodule in Rt lobe of liver\r\n-	CT (9 Jul 16): Small fibrotic nodule (2.2x1.4cm) in Rt lobe of liver, Seg 8. DDx : regenerating nodule.\r\n-	Noted brother passed away with Ca oesophagus\r\n-	Abdominal discomfort esp: in the morning.  Feeling of difficulty in passing urine.  High colour urine.', '', '', '1.	Tenofovir 300mg OD', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 13:04:04.992222', '17', '2016-07-25 12:04:05.667588');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01002', 'Reviewed by Dr Thwin on 21-Jul-16\r\nHb – 11.7  9.8 (Improving)\r\nH pylori – negative\r\nUSG abdomen – gall bladder wall thick (4.84mm x 5.05mm), gall stones\r\nPhysical examination\r\nAfeb\r\nBP 104/65mmHg\r\nImpression\r\n1.	Asymptomatic gall stones with gall bladder wall thickening\r\n2.	Anemia likely due to heavy mens\r\n3.	Ovarian cyst on Ultrasound \r\nMedications prescribed\r\n1.	Ferrovit x 3months\r\n2.	Cetirizine 10mg OD x 10 years due to itchiness over face and both\r\nPlan\r\nRecommend to remove gall bladder in light of gall bladder thickening\r\nExplain about key hole surgery\r\nAdvise the patient to go to A&E if the patient feels pain in RHC, dark colored urine and clay colored stool and fever\r\nSuggest to see Gynaecologist for irregular mens\r\nTCU: 3 month with full blood count', '', '', 'Current medications\r\n1.	Cetirizine 10mg OD x 10 years due to itchiness over face and both\r\n2.	Ferrovit (Ferrous fumerate + Folic acid + B12) 1 BD\r\n3.	Urso 1 BD\r\n4.	Esomeprazole 40mg OD', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:13:25.906758', '17', '2016-07-25 14:13:25.906758');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01006', 'U Tin Oo Lwin, 58 years, LDLT Dec 2015 for HCC + Hepatitis C, AFP secretor (highest 2400 at 2004, latest 970 June 16). AFP normalized 2 months after post-transplant.\r\nHepatitis C genotype 3\r\nPulmonary TB on anti-TB treatment started 25-Nov-2015, plan for 1 year, Biopsy proven. Now on Ethanbutaol 800mg OD and INH 300mg OD and Ofloxacin 400mg BD\r\nExplant: Multifocal moderately differentiated HCC, Total tumor numbers: 7, total size: 8.6 cm, no PV involvement\r\nHepatits C on Sofosbuvir 400mg OM and Daclatasvir 60mg OM started on 7-June-16\r\nLatest PET scan (3-June-16): no radiological evidence of HCC recurrence\r\nCo-Morbid\r\n-	DM on insulin lantus\r\n-	Pulmonary TB\r\nCurrent Medications\r\n1.	Tacrolimus 1.5mg/1mg (reduce it from 2.5mg/2mg on 2-June-16)\r\n2.	Cellcept 250mg BD (reduce it from 500mg BD on 30-March-16)\r\n3.	Sirolimus 3mg / 2mg (increased it from 1mg BD)\r\n4.	Prednisolone 7.5mg OD (reduced it from 10mg on 17-March-16)\r\n5.	Sofosbuvir 400mg OM started from 7-June-16\r\n6.	Daclatasvir 60mg OM started from 7-June-16\r\n7.	Ethanbutol 800mg OD\r\n8.	INH 300mg OD\r\n9.	Ofloxacin 400mg BD\r\n10.	Vitamin B6 20mg OD\r\n11.	Vitamin C 500mg OD\r\nIssues\r\n-	Post liver transplant patient with rising AFP \r\n-	DM\r\n-	Pulmonary TB\r\nPlan\r\n-	Add Sorafenib 200mg BD x 2weeks, plan to increase to 400mg BD as the patient is tolerated\r\n-	To do LFT, FBC, Urea and electrolyte, Magnesium level, HbA1c, AFP, HCV viral load, Tacroliumus level, Siroliumus level on 20-June-16\r\n-	Continue anti-TB medications to complete at least 1 year\r\n-	Hold off Ribavirin in view of Low Hb level (10.6)\r\n-	TCU 29-June-16\r\nSeen by Dr Thwin Maung Aye on 29-June-16\r\nNoted\r\n-	Siroliumus – 7.7\r\n-	Tacrolimus - <2\r\n-	HbA1c 8.8\r\n-	Uric acid – 330\r\n-	Mg – normal, GGT – normal\r\n-	AFP - >1000\r\n-	Urea, Sodium, Potassium, Albumin – normal\r\n-	ALT – 22.1, AST – 30, ALP – 58\r\n-	Hb 10.7, WBC 2.93 (Neutrophil 1.87), Plt – 70\r\n-	Total bil – 0.11\r\n-	HCV viral load (week 2) – Not Detected\r\nConsultation note\r\nBody weight 53kg\r\nAfeb\r\nBP 160/90mmHg\r\nImmunosuppression level are acceptable\r\nNoted HbA1c – 8.8\r\nPatient is start taking sorafenib 400mg BD and tolerated so far\r\nReduced Prednisolone to 2.5mg daily since 26-June-16\r\nHome BP is around 140mmHg\r\nCurrent Medications\r\n1.	Tacrolimus 1.5mg/1mg (reduce it from 2.5mg/2mg on 2-June-16)\r\n2.	Cellcept 250mg BD (reduce it from 500mg BD on 30-March-16)\r\n3.	Sirolimus 3mg / 2mg (increased it from 1mg BD)\r\n4.	Prednisolone 2.5mg OD (reduced it from 5mg on 26-June-16)\r\n5.	Sofosbuvir 400mg/200mg started from 23-June-16\r\n6.	Daclatasvir 60mg OM started from 7-June-16\r\n7.	Ethanbutol 800mg OD\r\n8.	INH 300mg OD\r\n9.	Ofloxacin 400mg BD\r\n10.	Vitamin B6 20mg OD\r\n11.	Vitamin C 500mg OD\r\nIssues\r\n-	Post liver transplant patient with rising AFP \r\n-	DM (HbA1c 8.8 on June 16)\r\n-	Pulmonary TB\r\n\r\nPlan\r\n1.	Reduce Prednisolone to 1 mg daily x 1 week starting from 4-July-2016 and then stopped on 11-July-2016\r\n2.	KIV reduce/stop Cellcept in next visit\r\n3.	Increase Sorafenib to 400mg BD if the patient is tolerated \r\n4.	To repeat PET scan on 1st week of September 2016 in India as planned\r\n5.	Continue anti-TB medications to complete at least 1 year\r\n6.	Advise to monitor home sugar level and diet control in light of HbA1c 8.8\r\n7.	Advise to monitor BP at home\r\n8.	AFP Singapore 4-Jul-16\r\n9.	TCU 1 month with \r\n-	FBC, PT/INR\r\n-	ALT, AST, ALP, Total Bilirubin\r\n-	AFP (Singapore) on 11-Jul-16 \r\n-	Sirolimus level (Sinigapore) on 11-Jul-16\r\n-	Tacroliums level (Singapore) on 11-Jul-16\r\n-	HCV viral load (week 4)\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nReviewed by Dr Thwin on 21-Jul-16\r\nALT – 20.2, AST – 35, ALP – 70, Total Bil – 0.4, Albumin 3.2\r\nAFP – 2671 (upward trend)\r\nHb – 10.1, TWC – 2.6 (Neutrophil 1.59, Lymphocyte – 0.57), Plt – 48 (downward trend), INR – 1.04\r\nUrea – 6.7, Creatinine – 100, Na – 139, K – 4.3\r\nHCV VL – Not detected (week 4)\r\nTacroliumus – 2.3, Sirolimus – 10.5\r\nMg, HbA1c – Not done\r\nPatient can tolerate Sorafenib 400mg BD\r\nNoted Prednisolone has been stopped on 11-Jul-16\r\nC/O peri-orbital oedema x 1 weeks\r\nPhysical examination\r\nAfeb\r\nBP 165/87mmHg\r\nO/E: NAD\r\nCurrent Medications\r\n1.	Tacrolimus 1.5mg/1mg (reduce it from 2.5mg/2mg on 2-June-16)\r\n2.	Cellcept 250mg BD (reduce it from 500mg BD on 30-March-16)\r\n3.	Sirolimus 3mg / 2mg (increased it from 1mg BD)\r\n4.	Prednisolone 2.5mg OD (reduced it from 5mg on 26-June-16)\r\n5.	Sofosbuvir 400mg/200mg started from 23-June-16\r\n6.	Daclatasvir 60mg OM started from 7-June-16\r\n7.	Ethanbutol 800mg OD\r\n8.	INH 300mg OD\r\n9.	Ofloxacin 400mg BD\r\n10.	Vitamin B6 20mg OD\r\n11.	Vitamin C 500mg OD\r\n12.	Sorafenib 400mg BD\r\n13.	Insulin 10U-10U-6U\r\n14.	Lantus insulin 10U HS\r\nPlan\r\nTo repeat PET scan in 1st week of Sep 16.  To repeat HCV viral load in Sep 16\r\nStop Cellcept in light of pancytopenia\r\nTo do CMV DNA in view of lymphopenia with thrombocytopenia\r\nTo do Urine protein:creatinine ratio in light of peri-orbital oedema\r\nKIV start Amlodipine 5mg OD if home BP is high\r\nTo repeat on 27-Jul-16\r\n1.	FBC\r\n2.	Hepatic functional package\r\n3.	Urea and creatinine\r\nTCU: Aug 16 with FBC, Hepatic functional package, urea and creatinine, tacrolimus and sirolimus level', '', '', 'Current Medications\r\n1.	Tacrolimus 1.5mg/1mg (reduce it from 2.5mg/2mg on 2-June-16)\r\n2.	Cellcept 250mg BD (reduce it from 500mg BD on 30-March-16)\r\n3.	Sirolimus 3mg / 2mg (increased it from 1mg BD)\r\n4.	Prednisolone 2.5mg OD (reduced it from 5mg on 26-June-16)\r\n5.	Sofosbuvir 400mg/200mg started from 23-June-16\r\n6.	Daclatasvir 60mg OM started from 7-June-16\r\n7.	Ethanbutol 800mg OD\r\n8.	INH 300mg OD\r\n9.	Ofloxacin 400mg BD\r\n10.	Vitamin B6 20mg OD\r\n11.	Vitamin C 500mg OD\r\n12.	Sorafenib 400mg BD\r\n13.	Insulin 10U-10U-6U\r\n14.	Lantus insulin 10U HS', '0', '', '', '', '0', '0', '0', '0', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '17', '2016-07-23 09:59:25.389424', '17', '2016-07-22 12:40:48.001508');
