INSERT INTO `tblhistory` VALUES ('V20160721CBL01009', 'Reviewed by Dr Thwin on 21-Jul-16\r\nIgG 23.7\r\nAnti-LKM, Anti- smooth muscle, ANA, anti-mitochondrial Ab  All negative\r\nAFP – 7.12\r\nHBV viral – 6.72 x 102\r\nCT scan : COL\r\nImpression: \r\nChild A liver cirrhosis with underlying chronic hepatitis B infection \r\nMedications\r\n1.	Entecavir 0.5mg OD\r\nPlan\r\nOGD for varices surveillance in 3 months time \r\nContinue Entecavir\r\nMonitor with Ultrasound and CT scan 6monthly alternatively\r\nAdvise low salt diet and less fatty food\r\nMay need liver transplant in future if COL is progress\r\nTCU\r\n3 months with\r\n-	FBC, PT/INR\r\n-	Hepatic function package\r\n-	Creatinine', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:16:04.044236', '17', '2016-07-25 14:15:18.102155');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01010', 'Reviewed by Dr Thwin on 21-Jul-16\r\nNoted blood results\r\nAlbumin 3.8, ALT 45, AST 36, ALP 78, Total Bil 1\r\nUrea 13, Creatinine 1.1, Na 140, K 3.5\r\nHEV viral load – NR, HAV viral load - NR\r\nCMV DNA - NR\r\nHSV DNA – NR\r\nHBV DNA – NR\r\nHCV DNA - NR\r\n25-OH VIt D 26.9\r\nINR 1.1\r\nHbA1c 4.7\r\nHb 14.4, TWC 3.49 (ANC 2.14, Lymphocyte 0.93), Plt 111\r\nCholesterol 137, HDL 33 (low), LDL 85, TG 94\r\nCalcium 2.25, PO4 0.79 (low)\r\nUrine Protein: Creatinine ratio 50 (High)\r\nSirolimus level 7.2\r\nUltrasound Liver: Normal\r\nAfeb\r\nBP 141/104mmHg (Home BP 130-90mmHg)\r\nBody weight 81.4kg\r\nCurrent medications\r\n1.	Sirolimus 1mg OD (reduced 1mg BD from Jul 16)\r\n2.	MMF 500mg BD (reduced it from 1000mg BD Oct 15)\r\n3.	Tenofovir 300mg OD\r\n4.	Cal + Vit D\r\n5.	Vit E 400IU BD\r\n\r\n\r\n\r\n6.	Add tacrolimus 1mg BD\r\n7.	GNC phosphate 1tab OD\r\nPrednisolone stopped on May 16\r\nTacrolimus has stopped in Sep 15 in view of rising creatinine level\r\nIssues\r\n1.	Post LDLT (Hepatitis B + HCC)\r\n2.	Proteinuria\r\n3.	?NASH\r\nPlan\r\nAdd Tacrolimus 1mg BD and reduce Sirolimus to 1mg OD in light of proteinuria. Future plan: tacrolimus + MMF in light of proteinuria and low risk HCC\r\nRepeat LFT and tacrolimus 2 weeks after changing the immunosuppression\r\nKIV annual screen in Jan 2017\r\nTCU: 1 month with\r\n1.	FBC\r\n2.	Hepatic functional package\r\n3.	Creatinine level\r\n4.	Tacrolimus level\r\n5.	Phosphate level\r\n6.	Urine protein: creatinine ratio\r\n7.	AFP', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:21:39.992826', '17', '2016-07-25 14:21:39.992826');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01011', 'Consultation notes\r\nChief complaints\r\nVomiting of recently eating food x 3months\r\nAbdominal discomfort x 3months\r\nBreathlessness during sleep off and on x 3months\r\nItchiness the whole body x 3years\r\nNo constipation\r\nECG : Supraventricular extrasystole, 1st degree heart block\r\nStress test (2014)  normal\r\nLiver enzymes are normal, HBV and HCV - negative\r\nPhysical Examinations\r\nPedal oedema (+), ? Ascites, no palpable liver and spleen\r\nLungs and heart clear \r\nActive issues/Problem lists\r\n1.	Poorly controlled Diabetes (HbA1c 8.1 March 16)\r\n2.	Dyslipidemia\r\n3.	Osteoporosis\r\n4.	?Diabetes gastroparesis to rule out organic lesion\r\n5.	Dyspnea on exertion\r\nPlan\r\nRefer to Cardiologist for further evaluation of heart status \r\nKIV OGD in next month after cardiac review\r\nAdd Domperidone 10mg TDS and Rabeprazole 10mg BD x 2 weeks\r\nInvestigations orders\r\n1.	Pro BNP\r\n2.	Urea and electrolytes\r\n3.	Creatinine, eGFR\r\n4.	HbA1c\r\n5.	Lipid profile\r\n6.	Urine Albumin: Creatinine ratio\r\nTCU: 1 month', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:18:41.308112', '17', '2016-07-22 11:09:21.406647');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01012', 'Reviewed by Dr Thwin on 21-Jul-16\r\nALT 21, AST 28, ALP 58, Total Bil 0.6\r\nCT (Abdomen and pelvis and Thorax): 3.0 x 2.9 x 1.5cm hypodense mass in left side of anterior mediastinum.  Thymoma is possible cause. D.Dx enlarged lymph node. Bilateral small renal cysts\r\nCA 125 – normal, AFP – normal\r\n25 – OH Vitamin D <12.9\r\nPO4 3.2\r\nNoted OGD and Colonoscope (2015) : Normal\r\nAbdominal pain/left shoulder pain still off and on\r\nIssues\r\n1.	IBS\r\n2.	? Thymoma\r\n3.	Vitamin D deficiency\r\nMedications\r\n1.	Rabeprazole 10mg ½ hour before breakfast\r\n2.	Spacovin 40mg TDS/PRN\r\n3.	Continue Tenofovir, monotrate and losartan\r\n4.	Add Calcium + Vit D supplement 1 tab BD\r\nPlan\r\nTo take Rabeprazole and Spacovin regularly\r\nKIV refer to thoracic surgeon for further evaluation of Thymoma\r\nTCU: open date', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:17:43.026410', '8', '2016-07-22 10:24:52.351729');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01013', 'Consultation notes\r\nNoted blood results\r\nUltrasound liver : Early fatty changed liver\r\nAlbumin 4, ALT 27, AST 37, ALP 53, Total Bl 1.3 (Unconjugated Bil 1.2, Conjugated 0.1)\r\nUrea 10, Creatinine 1\r\nHb 15.5, TWC 6.05, Plt 333\r\nCholesterol 183, TG 49, LDL 118, HDL 55\r\nChief complaints\r\nMedical check up \r\nPhysical Examinations\r\nAfeb\r\nBP 113/71mmHg\r\nBMI 20.1\r\nActive issues/Problem lists\r\n1.	Fatty liver\r\n2.	Hyperlipidemia\r\nPlan\r\nAdvise to do exercise and eat less fatty food and salty diet\r\nAdd Atorvastatin for better lipid control and fatty liver on ultrasound\r\nInvestigations\r\n1.	Fibroscan\r\nMedications\r\n1.	Amlodipine 5mg OM\r\n2.	Aspirin 1 tab OM\r\n3.	Atorvastatin 10mg HS\r\n\r\nTCU 1 months with Fibroscan result and hepatic function package, fasting lipid profile', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:20:01.057452', '17', '2016-07-25 14:20:01.057452');
INSERT INTO `tblhistory` VALUES ('V20160721CBL01015', 'Abdominal discomfort in right upper abdomen for 2 months.\r\nNo nausea or vomiting\r\nNormal appetite and bowel habit.\r\nAST – 15\r\nALT – 13\r\nT. Bil – 11\r\nALP – 56\r\nHbA1C – 7.8%\r\nCreatinine – 94mcgmol/L\r\nT. chol – 5.92, TG – 2.10, HDL – 1.1, LDL – 4.3\r\nUSG (abd) – tiny gall stone and mild fatty liver\r\nFeeling hot in RHC x 2 months, not related to food, no shoulder pain, no nausea and vomiting\r\nPain in RHC off and on x 2 years. OGD (2014)  normal, Gall bladder stones (+).\r\nHistory of pain in RHC and vomiting last year after eating fried rice.', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 13:46:23.467308', '17', '2016-07-25 13:46:08.990483');
