INSERT INTO `tblhistory` VALUES ('V20160725CBL01003', 'Daw Ma Shwe Mi, 54 years\r\nLDLT on 30-Oct-15\r\nIndications: Hep C cirrhosis (genotype 3b) + HCC\r\nMELD 22 at the time of transplant\r\nDonor: elder sister, donor is seems to be total core positive\r\nBlood group: O positive\r\nExplant: HCC, 3.2 cm single lesion, well-differentiated, AFP – non-secretor\r\nNo acute cellular rejection.  Reperfusion injury on biopsy (13-Nov-15)\r\nCo-Morbid\r\n-	Nil\r\n-	?NODAT\r\nHepatitis C treated with Sofos + Daclatasvir + ribavirin started on 8-Jan-16 and stopped on 9-Apr-16 \r\nHCV Viral load: Not Dectected (3-May-16)\r\nCurrent Medications\r\n1.	Siroliumus 1mg OD (reduced it from 1.5mg OD on 3-May-16)\r\n2.	Tacrolimus 1mg BD (Reduced it from 1.5mg BD in Feb 16)\r\n3.	Cellcept 250mg BD (Started on 8-Jan-16)\r\n4.	Prednisolone 2.5mg OD (reduced it from 5mg OD on 3-May-16)\r\n5.	Entecavir 0.5mg OD (Donor total core positive)\r\n6.	Pantoprazole 1tab OM\r\nInvestigations \r\nUS doppler liver (March 16) in Myanmar: Normal\r\nFBC (20-June-16): Normal\r\nLFT (20-June-16): Acceptable\r\nRenal panel (20-June-16): Normal\r\nAFP (20-June-16): Normal\r\nThyroid function (March 16) : Normal\r\nPlan\r\n-	To do HCV viral load, Hepatic function panel, U & E, Creatinine, FBC, HbA1c, Siroliums level, Tacroliumus level, 25-OH vitamin D level, Calcium corrected, CMV viral load, urine C&S, Urine RE\r\n-	If creatinine is normal, to do CT triphasic (Thorax and abdomen)\r\n-	Stop Prednisolone (post-tx 8 months and LFT normal)\r\n-	Stop Pantoprazole \r\n-	Increase Sirolimus to 1mg BD\r\n-	Add Loratidine 10mg ON/PRN\r\n-	TCU 29-June-16\r\n-	To do HCV viral load in Jul 16\r\nSeen by Dr Thwin on 23-June-16\r\nWalk in visit due to headache and numbness of finger\r\nPlan\r\n-	Add paracetamol 500mg QDS/PRN\r\n-	Will review numbness with electrolyte result\r\n-	TCU as planned\r\nSeen by Dr Thwin Maung Aye on 29-June-16\r\nNoted results done on 24 June 16\r\nCT scan: Normal\r\nALT : 32  29, AST : 41  35, ALP : 89 (130), Total bil : 0.6\r\nSiroliumus 9.3\r\nTacrolimus 3.7\r\nUrea, Creatinine, Sodium  Normal\r\nPotassium 2.8  4\r\nCalcium  8.94 (Normal)\r\n25-OH Vit D  25.5 (low)\r\nHbA1c  6.4\r\nUrine C&S : Mixed growth (Contamination)\r\nHb  10.4, WBC  4.33, Plt  169\r\nConsultation note\r\nPuffiness of face   less compared to previous visit\r\nBody weight : 56.1kg\r\nBP 132/64mmHg\r\nNoted mild rise in AST\r\nImpression: \r\n1.	Post liver transplant patient for HCC + Hepatitis C with treated Hepatitis C infection\r\n2.	Vitamin D sufficiency\r\n3.	Hypokalaemia\r\nPlan\r\n1.	Add Span K 600mg BD x 3 days\r\n2.	To repeat Phosphate, Magnesium, Potassium, urine Protein Creatinine ratio, LFT on 2-Jul-16\r\n3.	TCU on 2-Jul-16\r\n4.	If LFT is normal, KIV stop Cellcept\r\n5.	TCU with Dr Thwin Maung Aye in July 16 with\r\n-	FBC\r\n-	LFT\r\n-	U & E, creatinine\r\n-	HCV viral load\r\n-	All the tests to be done 1 week before next TCU\r\nCurrent Medications\r\n1.	Siroliumus 1mg BD (reduced it from 1.5mg OD on 3-May-16)\r\n2.	Tacrolimus 1mg BD (Reduced it from 1.5mg BD in Feb 16)\r\n3.	Cellcept 250mg BD (Started on 8-Jan-16)\r\n4.	Entecavir 0.5mg OD (Donor total core positive)\r\n5.	Loratidine 10mg ON\r\n6.	Shelcal-M 1 tab TDS\r\nResults reviewed on 2-Jul-16\r\n-	ALT 33  32, AST 38  41, ALP 92  89, Total Bil 0.8  0.6, Albumin 3.9  3.7\r\n-	K – 4.1  2.8\r\n-	Mg, PO4 and urine PCR pending\r\nConsultation note\r\n-	Face – puffiness much relieved\r\n-	Noted potassium level is normal.  Stop Span K in light of normal potassium.\r\nPlan\r\n-	TCU as planned\r\nReviewed the patient on 6-Jul-16\r\nUnscheduled  visit\r\nC/O – cough without sputum x 2-3 days, no fever, sore-throat (+)\r\nHb 10.8, TWC 3.23 (Neutrophil 1.02), Plt  124\r\nESR 31\r\nCRP flat\r\nAlbumin 3.6, ALP 91, ALT 36, AST 49, Total bil 0.7\r\nCXR: slightly increased lung markings in both lower zones, slightly raised right hemidiaphragm\r\nUrine PCT – 0.06 (2-Jul-16)\r\nPO4 3.2 (2-Jul-16)\r\nMg 1.7 (2-Jul-16)\r\nNo Known drug allergy\r\nO/E\r\nAfeb\r\nBP – 140/70mmHg, BP at home 110-120/60mmHg\r\nLungs: reduce air entry on lower zone of the right lung, no crepitation\r\nHeart: I, II + 0\r\nNo palpable liver and spleen\r\nNo visible oral thrush\r\nTonsil ++\r\nImpression: URTI in immunosuppressed patient\r\nDiscuss with Dr Thwin\r\nPlan\r\n1.	Stop Cellcept in light of neutropenia and likely URTI \r\n2.	Augmentin 625mg BD x 5 days\r\n3.	Mucolytics\r\n4.	Strepsils\r\n5.	Continue Loratidine 10mg Daily\r\n6.	Moisturizing  cream for dry skin\r\n7.	To repeat\r\n-	FBC\r\n-	Hepatic function package\r\n-	CRP\r\n-	ESR\r\n8.	TCU on 9-Jul-16\r\nReviewed on 9-Jul-16\r\nNoted\r\nHb 11\r\nWBC 3.42 (Neutrophil 0.86)\r\nPlt 125\r\nESR 32\r\nAlbumin 3.6\r\nALT 37\r\nAST 52\r\nALP 104\r\nTotal Bil 0.5\r\nCRP flat\r\nCough still present.  Afeb.  No postural hypotension.  Air entry reduces on base of the right lungs. Noted inflammation at the upper gum and the patient has a permanent  denture (4 teeth). \r\nPatient has 1 episode of hypoglycemia (64mg%) last night, response to milo.  Repeated blood sugar level 114mg%.\r\nImpression\r\n1. Neutropenia with likely URTI\r\n2. Symptomatic hypoglycemia (1 Episode)\r\nDiscussed with Dr Thwin\r\nPlan\r\n1.	Reduce Sirolimus to 0.5mg BD \r\n2.	Antisepctic mouth gurgle\r\n3.	To monitor blood sugar level 3 times a day\r\n4.	To do Blood C&S and urine C&S today\r\n5.	To repeat FBC, ESR, CRP, Hepatic function package and sirolimus level on 11-July-16\r\n6.	KIV admission if further drop in neutrophil counts\r\n7.	TCU 11-July-16\r\nCurrent Medications\r\n1.	Siroliumus 0.5mg BD (reduced it from 1mg BD on 9-Jul-16)\r\n2.	Tacrolimus 1mg BD (Reduced it from 1.5mg BD in Feb 16)\r\n3.	Entecavir 0.5mg OD (Donor total core positive)\r\n4.	Loratidine 10mg ON\r\n5.	Shelcal-M 1 tab TDS\r\n6.	Augmentin 625mg BD \r\n7.	Mouth gurgle\r\n8.	Moisturizing cream\r\n\r\n\r\nReviewed by Dr Thwin on 21-Jul-16\r\n\r\nALT 79, AST 70 ALP 109, Alb 3.6, Total bil 0.4\r\nNa 137, K 3.7, Calcium 9.22\r\nCreatinine 0.5\r\nHbA1c 6.1\r\nHCV viral load NR (SVR 12)\r\nSirolimus 10.8 (Jul 16)\r\nTacrolimus level 2.2 (Jul 16)\r\nCMV DNA – Negative\r\nNoted Blood and urine culture : Negative\r\nNoted upward trend of liver enzymes\r\nNo more coughing, Puffiness of face is much relieved\r\n\r\nIssues\r\n\r\n1.	Post liver transplant patient (HCC + HCV) with mild transaminitis\r\n2.	Loose denture \r\n\r\nCurrent Medications\r\n\r\n1.	Siroliumus 0.5mg BD (reduced it from 1mg BD on 9-Jul-16)\r\n2.	Tacrolimus 2mg BD (increase it from 1mg BD in Jul- 16)\r\n3.	Entecavir 0.5mg OD (Donor total core positive)\r\n4.	Loratidine 10mg ON\r\n5.	Shelcal-M 1 tab TDS\r\n6.	Augmentin 625mg BD \r\n7.	Mouth gurgle\r\n8.	Moisturizing cream\r\n\r\nPlan\r\n\r\nIncreased Tacrolimus to 2mg BD in view of upward trend of liver enzymes and tacrolimus level of 2.2\r\nContinue Sirolimus\r\nRepeat LFT on 27-Jul-16\r\nRepeat LFT, tacrolimus and siroliumus level on 3-Aug-16\r\nAdvise to see Dentist for loose denture\r\n\r\nTCU: Aug 16', '', '', '', '0', '', '', 'No', '0', '0', '0', '0', '', 'Has DM & hypertension', '', '', '', '', 'Married', '', '', '', '', '', '', '', '17', '2016-07-25 14:10:41.794470', '17', '2016-07-25 11:26:19.120001');
