INSERT INTO `tblvisit` VALUES ('V20160426CBL01001', '20160426CBL01001', '2016-04-26', '', '26', '50', '156', '156', '20.55', '', '17', '2016-04-26 09:10:18.000000', '17', '2016-07-05 09:47:24.597102', '', 'CBL011201604260001');
INSERT INTO `tblvisit` VALUES ('V20160426CBL01002', '20160426CBL01001', '2016-04-26', '-', '26', '50', '156', '156', '20.55', '', '17', '2016-04-26 09:10:25.000000', '17', '2016-07-22 09:16:58.302095', '26 Apr 2016\nMr Aye Win\nSeen by Dr Thwin Maung Aye\nPatient is known to us for Ulcerative colitis\nColonoscopy was done in Myanmar (19 March 2016) and repeated colonoscopy in NUH (9 Apr 2016).  NUH colonoscope showed some improvement but still present pancolitis.\nBiopsy (Myanmar) showed ulcerative colitis sigmoid colon\nBiopsy (NUH) showed diffuse active chronic colitis, ulcerative colitis should be considered in the differential\nThe patient was on \n1.	Sulfasalaine 4G OM (started on 20 March 16)\n2.	Prednisolone 10mg OM since 23-Apr-16 (started on Prednisolone 30mg OM on 20 March 16)\n3.	Mesalazine ENEMA 1 dose ON x 3weeks\nNoted Iron and iron saturation borderline low (5.5 μmol/L and 10%) (13-Apr-16)\nNoted 25-OH Vitamin D 5.1 (13-Apr-16)\nNow symptoms improved. 1 motion per day.\nPlan\n·	To do FBC and trace the result\n·	Hold off iron supplement in view of borderline iron level.  Advise on iron rich diet.\n·	Add Lynae 3 tablets daily for Vitamin D deficiency\n·	Continue Sulfasalazine and Prednisolone as planned\n·	Keep TCU at Dr Michelle at NUH\n·	KIV recheck colonoscope in 4-6 months time\n·	Need yearly colonoscope for Colo-rectal cancers surveillance \n\n\nDr Thwin Maung Aye\nMB;BS, MRCP (UK), FRCP (Edin), FAMS Gastroenterology (Singapore)\nConsultant Gastroenterologist & Hepatologist\nSAMA: 14851\n', 'CBL011201604260002');
