s\nPhysical Examinations\nAfeb\nBP 115/66mmHg\nWeight 61.6kg\nO/E\nCentral peri-umbilical dullness, shifting dullness (+)\nActive issues/Problem lists\n1.	Abdominal pain with weight loss to rule out organic lesion for further evaluation\nPlan\nContinue Hepatitis B and hypertension treatment\nTo review on 21-Jul-16 with scan and blood results\nTo bring the previous scopes results\nInvestigations orders\n1.	Creatinine \n2.	If creatinine is normal CT (Abdomen and pelvis) triphasic and CT (thorax)\n3.	CA 125\n4.	AFP\n5.	Hepatic function package\n6.	HBV viral load\n7.	Calcium\n8.	Phosphate\n9.	25-OH vitamin D\n\nMedications\n1.	Rabeprazole 10mg ½ hour before breakfast\n2.	Spacovin 40mg TDS/PRN\nTCU: 21-Jul-16\n\nReviewed by Dr Thwin on 21-Jul-16\nALT 21, AST 28, ALP 58, Total Bil 0.6\nCT (Abdomen and pelvis and Thorax): 3.0 x 2.9 x 1.5cm hypodense mass in left side of anterior mediastinum.  Thymoma is possible cause. D.Dx enlarged lymph node. Bilateral small renal cysts\nCA 125 - normal, AFP - normal\n25 - OH Vitamin D <12.9\nPO4 3.2\nNoted OGD and Colonoscope (2015) : Normal\nAbdominal pain/left shoulder pain still off and on\n\nIssues\n1.	IBS\n2.	? Thymoma\n3.	Vitamin D deficiency\n\nMedications\n1.	Rabeprazole 10mg ½ hour before breakfast\n2.	Spacovin 40mg TDS/PRN\n3.	Continue Tenofovir, monotrate and losartan\n4.	Add Calcium + Vit D supplement 1 tab BD\n\nPlan\nTo take Rabeprazole and Spacovin regularly\nKIV refer to thoracic surgeon for further evaluation of Thymoma\nTCU: open date\n\nDr Thwin Maung Aye\nMBBS (Ygn), MRCP (UK), FRCP (Edin), FAMS (Gastroenterology, S’pore)\nConsultant Gastroenterologist and Hepatologist\nSAMA: 14851\n', 'CBL011201607210012');
