-- ----------------------------
-- Procedure structure for `getBookingPK`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getBookingPK`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getBookingPK`(IN paraTableName VARCHAR(50), IN paraRegDate datetime)
BEGIN

	declare vlastBookNo varchar(10);

    declare vBranchCode varchar(5);

    declare strDate varchar(8);

    declare dateCnt int;

    

    SET SQL_SAFE_UPDATES=0;

    

    SET dateCnt = (SELECT COUNT(*) cnt FROM sysRegNoGen WHERE TableName=paraTableName AND RegDate = paraRegDate );

    

    IF (dateCnt > 0) THEN

    

		update sysRegNoGen SET LastRegNo=LastRegNo+1 WHERE TableName=paraTableName 	AND RegDate=paraRegDate;

	ELSE 


	END IF;

    

    SET vBranchCode = (SELECT branchCode FROM sysSetting);

    

    select concat('B',date_format(RegDate,'%Y%m%d'),vBranchCode,substring(concat('000',lastRegNo),-3)) NewRegNo from sysRegNoGen where TableName = paraTableName and RegDate = paraRegDate;



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getID`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getID`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getID`(IN paraTableName VARCHAR(50))
BEGIN

	DECLARE maxid INT;

    DECLARE minid INT;

    DECLARE Newid INT; 

    DECLARE vLastID INT;

    

    SET maxid=(SELECT maxid

	FROM sysIDGen

	WHERE tableName=paraTableName);

	

	SET minid=(SELECT minid

	FROM sysIDGen

	WHERE  tableName=paraTableName);

	

	SET vLastID=(SELECT lastid

	FROM sysIDGen

	WHERE  tableName=paraTableName);



	SET SQL_SAFE_UPDATES=0;



	IF (minid>vLastID) THEN

		UPDATE sysIDGen SET lastID=minid WHERE tableName = paraTableName;

		

	ELSE

		UPDATE sysIDGen SET lastID=lastID+1 WHERE tableName=paraTableName;

		

	END IF;

    

    SELECT lastid

	FROM sysIDGen

	WHERE  tableName=paraTableName;

    

    

END
;;
DELIMITER ;

