-- Procedure structure for `getRegNo`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getRegNo`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getRegNo`(IN paraTableName VARCHAR(50), IN paraRegDate datetime)
BEGIN



	declare vlastRegNo varchar(10);

    declare vBranchCode varchar(5);

    declare strDate varchar(8);

    declare dateCnt int;

    

    SET SQL_SAFE_UPDATES=0;

    

    SET dateCnt = (SELECT COUNT(*) cnt FROM sysRegNoGen WHERE TableName=paraTableName AND RegDate = paraRegDate );

    

    IF (dateCnt > 0) THEN

    

		update sysRegNoGen SET LastRegNo=LastRegNo+1 WHERE TableName=paraTableName 	AND RegDate=paraRegDate;

	ELSE 


	END IF;

    

    SET vBranchCode = (SELECT branchCode FROM sysSetting);

    

    select concat(date_format(RegDate,'%Y%m%d'),vBranchCode,substring(concat('000',lastRegNo),-3)) NewRegNo from sysRegNoGen where TableName = paraTableName and RegDate = paraRegDate;

    

    



END
;;
