-- ----------------------------
-- Procedure structure for `getVisitNo`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getVisitNo`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getVisitNo`(IN paraTableName VARCHAR(50), IN paraRegDate datetime)
BEGIN



	declare vlastRegNo varchar(10);

    declare vBranchCode varchar(5);

    declare strDate varchar(8);

    declare dateCnt int;

    

    SET SQL_SAFE_UPDATES=0;

    

    SET dateCnt = (SELECT COUNT(*) cnt FROM sysRegNoGen WHERE TableName=paraTableName AND RegDate = paraRegDate );

    

    IF (dateCnt > 0) THEN

    

		update sysRegNoGen SET LastRegNo=LastRegNo+1 WHERE TableName=paraTableName AND RegDate=paraRegDate;

	ELSE 


	END IF;

    

    SET vBranchCode = (SELECT branchCode FROM sysSetting);

    

SELECT 
    CONCAT('V',
            DATE_FORMAT(RegDate, '%Y%m%d'),
            vBranchCode,
            SUBSTRING(CONCAT('000', lastRegNo), - 3)) NewRegNo
FROM
    sysRegNoGen
WHERE
    TableName = paraTableName
        AND RegDate = paraRegDate;

    

    



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `getVoucherNo`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getVoucherNo`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getVoucherNo`(IN paraTableName varchar(20),IN paraInvDate datetime,IN paraCountNo varchar(10))
BEGIN

		declare vlastBookNo varchar(10);

    declare vBranchCode varchar(5);

    declare strDate varchar(8);

    declare dateCnt int;

    

    SET SQL_SAFE_UPDATES=0;

    

    SET dateCnt = (SELECT COUNT(*) cnt FROM sysGenVoucherNo WHERE TableName=paraTableName AND InvDate = paraInvDate AND counterNo = paraCountNo);

    

    IF (dateCnt > 0) THEN

    

		update sysGenVoucherNo SET LastVocNo=LastVocNo+1 WHERE TableName=paraTableName 	AND InvDate=paraInvDate AND counterNo = paraCountNo;

	ELSE 


	END IF;

    

    SET vBranchCode = (SELECT branchCode FROM sysSetting);

    

    select concat(vBranchCode,paraCountNo,date_format(InvDate,'%Y%m%d'),substring(concat('0000',LastVocNo),-4)) NewRegNo from sysGenVoucherNo where TableName = paraTableName and InvDate=paraInvDate AND counterNo = paraCountNo;



END
;;
DELIMITER ;

